import React from 'react'
import { NavLink } from 'react-router-dom'

const NavbarLinks = () => {
    return (
        <ul classname="action pull-right btn-primary">
            <li><NavLink to='/add-recipe'>Add Recipe</NavLink></li>
        </ul>  
    )
}

export default NavbarLinks;
